import React from "react";

// CSS
import styles from './Login.module.css';
import Input from "../../Layouts/Input";

const Login = () => {
    return(
        <div className="container">
            <h1>Login</h1>
            <form>
                <Input 
                name="name" 
                text="Nome" 
                type="text" 
                value="" 
                placeholder="Seu nome"/>
            </form>
        </div>
    );
}

export default Login;
